import React from 'react'
import axios from 'axios';
import { useEffect,useState } from 'react';
import {Bar,Line,Pie} from "react-chartjs-2";
import{Chart as ChartJS} from "chart.js/auto"
import { parse } from 'papaparse';
import 'chartjs-adapter-luxon';






const urlv8 = 'http://localhost:8080/v8'





export default function V8() {


  const [v8, setv8] = useState([])

  useEffect(() => {
    axios.get(urlv8)
      .then((response) => {
        console.log(response.data)
        setv8(response.data)
      }).catch(error => {
        alert(error.response.error)
      })
  }, [])


 
  const v8chart = {
    labels: v8.map(d => d.time),
    datasets: [
      {
        label: 'china',
        backgroundColor: 'rgba(255,255,255,1)',
        borderColor: 'rgba(255,255,255,1)',
        borderWidth: 2,
        data: v8,
        spanGaps: false,
        parsing: {
          xAxisKey: 'time',
          yAxisKey: 'china'
        }
      },
      {
        label: 'finland',
        backgroundColor: 'rgba(255,255,255,1)',
        borderColor: 'rgba(255,255,255,1)',
        borderWidth: 2,
        data: v8,
        spanGaps: false,
        parsing: {
          xAxisKey: 'time',
          yAxisKey: 'Finland'
        }
      }
    ]
  }
  
  const options = {
    type:'line',
    responsive: true,
    plugins: {
      legend: {
        position: "top",
      },
      title: {
        display: true,
        text: "Global historical surface temperature anomalies from January 1850 onwards",
      },

    },

  }


  return (
    <div>
      <Line options={options} data={v8chart} />


    </div>
  )
}
